import Foundation
import simd
import MathKit

public struct SKSpaceGroupSetting
{
  public var number: Int = 0
  public var spaceGroupNumber: Int  // space group number (1-230)
  var order: Int
  var ext: UInt8               // '1', '2', 'H', 'R' or '\0'
  var qualifier: String        // e.g. "-cba" or "b1"
  public var HM: String               // H-M symbol; nul-terminated string
  public var Hall: String             // Hall symbol; nul-terminated string
  var encodedGenerators: [UInt8]  // encoded seitz matrix-generators
  var encodedSeitz: [UInt8]       // encoded seitz matrix
  var inversionAtOrigin: Bool
  var inversionCenter: SIMD3<Int32>
  var standard: Bool = false
  var symmorphicity: Symmorphicity = .asymmorphic
  var centring: SKSpacegroup.Centring
  public var latticeTranslations: [SIMD3<Int32>] = []
  var schoenflies: String
  var pointGroup: SKPointGroup
  var pointGroupNumber: Int
  var asymmetricUnit: SKAsymmetricUnit
  
  public enum Symmorphicity: Int
  {
    case asymmorphic = 0
    case symmorphic = 1
    case hemisymmorphic = 2
  }
  
  public init(number: Int, spaceGroupNumber: Int, order: Int, ext: UInt8, qualifier: String, HM: String, Hall: String, inversionAtOrigin: Bool, inversionCenter: SIMD3<Int32> = SIMD3<Int32>(0,0,0),  symmorphicity: Symmorphicity, standard: Bool, centring: SKSpacegroup.Centring, latticeTranslations: [SIMD3<Int32>], pointGroupNumber: Int, schoenflies: String, generators: String, encoding: String, asymmetricUnit: SKAsymmetricUnit)
  {
    self.number = number
    self.spaceGroupNumber = spaceGroupNumber
    self.order = order
    self.ext = ext
    self.qualifier = qualifier
    self.HM = HM
    self.Hall = Hall
    self.inversionAtOrigin = inversionAtOrigin
    self.inversionCenter = inversionCenter
    self.symmorphicity = symmorphicity
    self.standard = standard
    self.centring = centring
    self.latticeTranslations = latticeTranslations
    self.schoenflies = schoenflies
    self.pointGroupNumber = pointGroupNumber
    self.pointGroup = SKPointGroup(number: pointGroupNumber)
    self.encodedGenerators = [UInt8](generators.utf8)
    self.encodedSeitz = [UInt8](encoding.utf8)
    self.asymmetricUnit = asymmetricUnit
  
    assert(self.encodedSeitz.count % 3 == 0, "Found: \(self.encodedSeitz.count) \(self.spaceGroupNumber) \(self.number) encoding: \(self.encodedSeitz) ")
  }
  
  
  public var fullSeitzMatrices: SKIntegerSymmetryOperationSet
  {
    assert(self.encodedSeitz.count % 3 == 0, "Found: \(self.encodedSeitz.count) \(self.spaceGroupNumber) encoding: \(self.encodedSeitz)")
    
    let centrosymmetric: Bool = SKPointGroup.pointGroupData[self.pointGroupNumber].centrosymmetric
    let m: Int = self.encodedSeitz.count/3
    let size: Int = centrosymmetric ? 2 * m : m
    let translationVectors: [SIMD3<Int32>] = self.latticeTranslations
    var matrices: [SKSeitzIntegerMatrix] = [SKSeitzIntegerMatrix](repeating: SKSeitzIntegerMatrix(), count: size * translationVectors.count)
    
    
    for i in 0..<m
    {
      let x: UInt8 = self.encodedSeitz[3 * i]
      let y: UInt8 = self.encodedSeitz[3 * i + 1]
      let z: UInt8 = self.encodedSeitz[3 * i + 2]
      
      matrices[i] = SKSeitzIntegerMatrix(encoding: (x,y,z))
    }
    
    if (centrosymmetric)
    {
      for i in 0..<m
      {
        let x: UInt8 = self.encodedSeitz[3 * i]
        let y: UInt8 = self.encodedSeitz[3 * i + 1]
        let z: UInt8 = self.encodedSeitz[3 * i + 2]
        
        let seitz:SKSeitzIntegerMatrix = SKSeitzIntegerMatrix(encoding: (x,y,z))
        
        let translation: SIMD3<Int32> = seitz.translation + seitz.rotation * self.inversionCenter
        matrices[m+i] = SKSeitzIntegerMatrix(rotation: -seitz.rotation, translation: translation)
      }
    }
    
    // use the translation vectors on all Seitz matrices
    for k in 1..<translationVectors.count
    {
      for i in 0..<size
      {
        matrices[size * k + i] = matrices[i]
        matrices[size * k + i].translation = matrices[size * k + i].translation + translationVectors[k]
      }
    }
    
    return SKIntegerSymmetryOperationSet(operations: matrices)
  }

  public var SeitzMatricesWithoutTranslation: [SKSeitzIntegerMatrix]
  {
    assert(self.encodedSeitz.count % 3 == 0, "Found: \(self.encodedSeitz.count) \(self.spaceGroupNumber) encoding: \(self.encodedSeitz)")
    
    let centrosymmetric: Bool = SKPointGroup.pointGroupData[self.pointGroupNumber].centrosymmetric
    let m: Int = self.encodedSeitz.count/3
    let size: Int = centrosymmetric ? 2 * m : m
    var matrices: [SKSeitzIntegerMatrix] = [SKSeitzIntegerMatrix](repeating: SKSeitzIntegerMatrix(), count: size)
    
    for i in 0..<m
    {
      let x: UInt8 = self.encodedSeitz[3 * i]
      let y: UInt8 = self.encodedSeitz[3 * i + 1]
      let z: UInt8 = self.encodedSeitz[3 * i + 2]
      
      matrices[i] = SKSeitzIntegerMatrix(encoding: (x,y,z))
    }
    
    if (centrosymmetric)
    {
      for i in 0..<m
      {
        let x: UInt8 = self.encodedSeitz[3 * i]
        let y: UInt8 = self.encodedSeitz[3 * i + 1]
        let z: UInt8 = self.encodedSeitz[3 * i + 2]
        
        let seitz:SKSeitzIntegerMatrix = SKSeitzIntegerMatrix(encoding: (x,y,z))
        
        let translation: SIMD3<Int32> = seitz.translation + seitz.rotation * self.inversionCenter
        matrices[m+i] = SKSeitzIntegerMatrix(rotation: -seitz.rotation, translation: translation)
      }
    }
    
    return matrices
  }
  
